import java.util.Scanner;public class Main {    public static void main(String args[]) {        Scanner s = new Scanner(System.in);        long a = s.nextLong();        long b = s.nextLong();        if(a == b){            System.out.print((10 * a) + " " + (10 * b + 1));            return;        }        if(a + 1 == b){            System.out.print((10 * a + 9) + " " + (10 * b));            return;        }        if(b == 1 && a == 9){            System.out.print(9 + " " + 10);            return;        }        System.out.print(-1);            }}
